import React from 'react';
import {DragDropContext, Droppable, Draggable} from "react-beautiful-dnd";
import './DraggableList.css';

const DraggableList = (props) => {

let array = [
    {
        id: 'list-1',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-2',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-3',
        title: 'Automatic',
        thumb: '/path/to/icon'
    },
    {
        id: 'list-4',
        title: 'Automatic',
        thumb: '/path/to/icon'
    }
]


  return (

    <DragDropContext>
        <Droppable droppableId="list">

        {/* {(provided)=>{ */}


            <ul className="myList" {...provided.droppableProps} ref={provided.innerRef}>
                {array.map(({id, title, thumb}, index) => {
                    return (
                        <Draggable key={id} draggableId={id} index={index}>

                            {/* {(provided)=>{
 */}

                                <li >
                                     <div>   {index+1 +". "}
                                    { title }
                                    </div>
                                </li>

                            {/* }} */}
                        </Draggable>
                    );
                })}
                {provided.placeholder}
            </ul>
        {/* }} */}
        </Droppable>
    </DragDropContext>
  )
}

export default DraggableList;
